import React from "react";
import ProModalNew from "../components/newproductmodal";
import ProdcutTable from "../components/producttable";
import {Link, useHistory } from "react-router-dom";
import NewProduct from "./addproductpage";


function Product() {

    function handleAdd() {
        <a href={'/addproduct'}> <Link to={`/addproduct`}>{NewProduct}</Link></a>

           
    }
    return(
        <div className="h-full w-screen flex justify-center">
            <div className="flex-col w-8/12 h-full">
                <ProdcutTable/>
                <div className="flex justify-end">
                <button 
                    type="button" 
                    className="text-white bg-green-700 hover:bg-green-800 focus:ring-4 focus:ring-green-300 font-medium rounded-lg text-sm px-5 py-2.5 mr-2 mb-2 dark:bg-green-600 dark:hover:bg-green-700 focus:outline-none dark:focus:ring-green-800"
                    onClick={handleAdd}>
                    Add Product
                </button>
                </div>
            </div>
            <ProModalNew/>
            
        </div>
    )
}

export default Product;
